#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <time.h>
#define TAM 100000

struct Celula{
    char tipo, garbage;
    struct Celula *direita, *esquerda;
};

struct Argumento{
    char *tipo;
    struct Argumento *direita, *esquerda, *proximo;
};


struct Pilha{
    struct Celula *cell;
    struct Pilha *next;
};
struct Celula heap[TAM];
struct Celula *free_list;
struct Celula *end_heap;
struct Celula *raiz;
struct Argumento *pilha;

void alocar_memoria(){
    //heap = (Celula*) calloc(100, sizeof(Celula));
    int i;
    for(i = 0; i < TAM-1;i++)
        (heap+i)->direita = (heap+i+1);
    free_list = heap;
    end_heap = heap+i;
    raiz = NULL;
}

struct Celula* alocar_celula(char tipo){
    struct Celula *alocado = free_list;
    free_list = free_list->direita;
    alocado->direita = 0;
    alocado->tipo = tipo;
    if(free_list == end_heap){
        printf("sem memoria");
        exit(0);
    }
    return alocado;
}
